    enum State {Active, Closed}
    State public state;
    modifier ifActive{require(state == State.Active); _;}

    mapping (address => uint256) public refundableBalances;

    constructor()
    AVault(){
        state = State.Active;
    }

    function close() 
    onlyRole(DEFAULT_ADMIN_ROLE) ifActive override external 
    {
        state = State.Closed;
        emit Closed();
    }

    function updateRefundableBalances(address investor, uint256 weiAmount) 
    ifActive onlyRole(DEFAULT_ADMIN_ROLE) override external
    {
        refundableBalances[investor] += weiAmount;
    }

    function deductRefundableBalances(address investor, uint256 weiAmount)
    onlyRole(DEFAULT_ADMIN_ROLE) override external
    {
        require(refundableBalances[investor] >= 0);
        if(refundableBalances[investor] >= weiAmount){
            refundableBalances[investor] -= weiAmount;
        }
    }

    function refund(address payable investor)
    onlyRole(DEFAULT_ADMIN_ROLE) override external 
    {
        require(refundableBalances[investor] > 0);
        uint256 depositedValue = refundableBalances[investor];
        refundableBalances[investor] = 0;

        (bool success,) = investor.call{value: depositedValue}("");
        require(success, "Ether transfer failed.");

        emit Refunded(investor, depositedValue);
    }

}

contracts/MarketWrapperFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;


import "./abstracts/factories/AMarketWrapperFactory.sol";


contract MarketWrapperFactory is AMarketWrapperFactory{

    address[] marketWrappers;
    uint256 count = 0;

    constructor()
    AMarketWrapperFactory()
    {}

    function newMarketWrapper (uint256 _buyNowPrice, address _marketPlace, bytes memory _transactionData, uint256 gasEstimate) 
    override external onlyRole(DEFAULT_ADMIN_ROLE)returns (address) 
    {
        MarketWrapper newWrapper = new MarketWrapper(_buyNowPrice, _marketPlace, _transactionData, gasEstimate);
        marketWrappers.push(address(newWrapper));
        count+=1;
        return address(newWrapper);
    }

    function giveContractOwnership(address _marketWrapper, address _to) 
    override external onlyRole(DEFAULT_ADMIN_ROLE)
    {   
        MarketWrapper curMarketWrapper = MarketWrapper(payable(_marketWrapper));
        curMarketWrapper.grantOwnerRole(_to);
    }

    function getLatestMarketWrapper() view override external returns (address) {
        return marketWrappers[count-1];
    }

}

